import React from 'react';

import Image from './Image';
import './style/Badge.css';
import heart from '../images/heart.gif';
import andre from '../images/Andre.jpg';

class Badge2 extends React.Component {
    render() {
        return (
            <div className="Badge">
                  <div className="Badge__section">
                     <img  className="Badge-photo" src={andre} width="600px" height="300px" alt="Foto"/>
                  </div>
                     <div className="Badge-info">
                   <ul className="list-unstyled">
                        <li>
                            <p><strong>Nombre: </strong>{this.props.name}</p>
                        </li>
                        
                        <li>
                            <p><strong>Edad: </strong> {this.props.old}</p>
                        </li>
                        <li>
                            <p><strong>Raza: </strong> {this.props.raza}</p>
                        </li>
                    </ul>
                   </div>
                   <div className="Badge__footer">#Condena sangrienta
                   <img src={heart} width="90px" />
                   </div>
            </div>
        );
    }
}

export default Badge2;
